import React, { useState } from 'react';
import { depositMoney } from '../utils/api';

function DepositForm() {
  const [accountId, setAccountId] = useState('');
  const [date, setDate] = useState('');
  const [amount, setAmount] = useState('');
  const [description, setDescription] = useState('');
  const [recipientAccount, setRecipientAccount] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();
    setMessage('');

    if (!date) {
      setMessage('Please select a date.');
      return;
    }

    try {
      const response = await depositMoney({
        accountId: parseInt(accountId),
        amount: parseFloat(amount),
        description,
        date, // send date if supported by backend
        recipient_account: recipientAccount ? parseInt(recipientAccount) : undefined, // optional
      });
      setMessage(`Deposit successful! New balance: ${response.data.balance}`);

      // Reset form
      setAccountId('');
      setDate('');
      setAmount('');
      setDescription('');
      setRecipientAccount('');
    } catch (error) {
      setMessage(`Deposit failed: ${error.response?.data?.message || error.message}`);
    }
  };

  return (
    <div>
      <h2>Deposit Money</h2>
      <form onSubmit={handleSubmit}>
        <div>
          <label>
            Type: <br />
            <input type="text" value="Deposit" readOnly />
          </label>
        </div>

        <div>
          <label>
            Date: <br />
            <input
              type="date"
              value={date}
              onChange={(e) => setDate(e.target.value)}
              required
            />
          </label>
        </div>

        <div>
          <label>
            Account ID: <br />
            <input
              type="number"
              placeholder="Account ID"
              value={accountId}
              onChange={(e) => setAccountId(e.target.value)}
              required
            />
          </label>
        </div>

        <div>
          <label>
            Amount: <br />
            <input
              type="number"
              min="0.01"
              step="0.01"
              placeholder="Amount"
              value={amount}
              onChange={(e) => setAmount(e.target.value)}
              required
            />
          </label>
        </div>

        <div>
          <label>
            Description: <br />
            <input
              type="text"
              placeholder="Description"
              value={description}
              onChange={(e) => setDescription(e.target.value)}
              required
            />
          </label>
        </div>

        <div>
          <label>
            Recipient Account (optional): <br />
            <input
              type="number"
              placeholder="Recipient Account ID"
              value={recipientAccount}
              onChange={(e) => setRecipientAccount(e.target.value)}
            />
          </label>
        </div>

        <button type="submit">Deposit</button>
      </form>

      {message && <p>{message}</p>}
    </div>
  );
}

export default DepositForm;
